aee638c5cbf2121b20d82d04f89c3653d16e10f3.source:
query fetchAllStudents {
  getAllStudents {
    __typename
    id
    name
    sex
    age
    tutor {
      __typename
      id
      name
      sex
      qualification
    }
    games
  }
}

8e8f76187a83d61851a34c2654fb4b5832c8997c.source:
query studentById($id: Int!) {
  getStudentById(id: $id) {
    __typename
    id
    name
    sex
    age
    tutor {
      __typename
      id
      name
      sex
      qualification
    }
    games
  }
}

c0200c51bd920572ccc848665365b0c3d09a312b.source:
query fetchAllTutors {
  getTutors {
    __typename
    name
    id
    sex
    qualification
  }
}

ec2547a95712a26b47d585c9ff5fe6caa35d3b0e.source:
mutation addTutor($id: Int, $name: String, $sex: String, $qualification: String) {
  addTutor(id: $id, name: $name, sex: $sex, qualification: $qualification) {
    __typename
    id
    name
    sex
    qualification
  }
}
